import {React} from 'react';
import {Link} from 'react-router-dom';

function Dropdown() {
    return (
        <div className="dropdown">
            <Link to="/"><button>Home</button></Link>
            <button>Analyze</button>
            <button>Predict</button>
        </div>
    )
}

export default Dropdown;
